import React, { useState,useEffect } from 'react'
import "./Catalog.css"
import bed from './bed.png';
import chair from './chair.png';
import couch from './couch.png';
import ctable from './ctable.png';
import desk from './desk.png';
import dresser from './dresser.png';
import lamp from './lamp.png';
import mirror from './mirror.png';
import shelf from './shelf.png';
import table from './table.png';

const Catalog = () => {

  return (
    <div className="catalog-container">
    
      <div className="catalogheader">
        <h1>Catalog</h1>
      </div>

      <div className="catalog-image-container">
      <img src={bed} alt = "bed img"/>
      <img src={chair} alt = "chair img"/>
      <img src={couch} alt = "couch img"/>
      <img src={ctable} alt = "ctable img"/>
      <img src={desk} alt = "desk img"/>
      <p> 1</p>
      <p> 2</p>
      <p> 3</p>
      <p> 4</p>
      <p> 5</p>
      <img src={dresser} alt = "dresser img"/>
      <img src={lamp} alt = "lamp img"/>
      <img src={mirror} alt = "mirror img"/>
      <img src={shelf} alt = "shelf img"/>
      <img src={table} alt = "table img"/>
      </div>

      <div className ="catalogfooter">
        <div className = "catalog">
          <a href="http://localhost:3000/" style={{float:'right'}}><button>Logout</button></a>
          <a href="http://localhost:3000/confirm" style={{float:'right'}}><button>Checkout</button></a>
        </div>
      </div>
      
    </div>
  )
}

export default Catalog
